import React from 'react'
import {contact} from '../components'

export default function contactsMasonry({Contacts}){
    console.log
    return( 
            <div  id="list-wrapper">         
                    {Contacts.map((contact, index) =>
                        <contact {...{contact, index}}/>
                    )}
              </div>
    )
}
